import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './Components/Navbar';
import Home from './Pages/Home';

function App() {
  return (
    <Router>
      <Navbar></Navbar>
      <Routes>
        <div className="App">
          <p className='text-red-200'>Jobhuntly</p>
        </div>
        <Route path='/' element={<Home></Home>}></Route>
      </Routes>
    </Router>

  );
}

export default App;
